import React, { Component } from 'react';
import Card from '@material-ui/core/Card';
import './CreateNote.css'

class CreateNote extends Component {
    render() {
        return (
            <div className="create-note-button">
                <Card>
                    <CardContent>
                        <button>
                            NewNote
                        </button>
                    </CardContent>
                </Card>
            </div>
        )
    }
}
